import Navbar from './component/layout/navebar';
import Landing from './component/layout/landing';

import './App.css';

class App extends Component {
  render() {
    return (
      <Fragment>
        <div className='App'>
          <Navbar />
          <Landing />
        </div>
      </Fragment>
    );
  }
}

